script: |
  super -f tsv -I q6128.sql | sort > q6128.out

vector: true

inputs:
  - name: q6128.sql
    data: |
      SELECT ALL col0 FROM tab1 WHERE + col0 NOT IN ( - 19, ( + col1 ) * - + col2 * - 12 + + col2 - - col0 * col1 * - 51 * - col1 );
  - name: tab1

outputs:
  - name: q6128.out
    data: |
      51
      85
      91
